static RTL *
SETS(ADDRESS pc, const std::string &name, Exp *dest, BRANCH_TYPE cond)
{
	auto bs = new BoolAssign();
	bs->setLeft(dest);
	bs->setCondType(cond);
	SHOW_ASM(name << " " << *dest);
	return new RTL(pc, bs);
}

